INSERT INTO `t_blog` (`id`, `tittle`, `slugname`, `foto`, `tanggal_post`, `status_post`, `id_category`, `content`, `id_user`) VALUES
(1, 'Haji dari Masa ke Masa. Dari Naik Unta Sampai Pesawat Murah, Begini Cara Orang Pergi ke Tanah Suci', 'Haji-dari-Masa-ke-Masa-Dari-Naik-Unta-Sampai-Pesawat-Murah-Begini ', '1522751700_hipwee-20101113144018935140_20-680x422.jpg', '2018-04-03 18:35:00', 0, 3, '<p><img class=\"size-medium wp-image-534611\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-Calon-Jemaah-Haji-640x369.jpg\" sizes=\"(max-width: 640px) 100vw, 640px\" srcset=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-Calon-Jemaah-Haji-640x369.jpg 640w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-Calon-Jemaah-Haji.jpg 663w\" alt=\"\" width=\"640\" height=\"369\"></p>\r\n<p class=\"wp-caption-text\">Perjalanan haji menggunakan kapal dagang via www.boombastis.com</p>\r\n<h3> </h3>\r\n<h3>2. Pada abad ke-18, tujuan utama mayoritas masyarakat Indonesia datang ke Mekkah bukan untuk beribadah haji, tapi berdagang dan belajar ilmu agama. Jemaah haji Indonesia umumnya dari kalangan petani, nelayan, dan peternak</h3>\r\n<div id=\"attachment_534612\" class=\"wp-caption aligncenter\"><img class=\"size-medium wp-image-534612\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-COLLECTIE_TROPENMUSEUM_Inschepen_van_pelgrims_op_weg_naar_Mekka_in_de_haven_van_Tandjong_Priok_West-Java_TMnr_10001263-640x673.jpg\" sizes=\"(max-width: 640px) 100vw, 640px\" srcset=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-COLLECTIE_TROPENMUSEUM_Inschepen_van_pelgrims_op_weg_naar_Mekka_in_de_haven_van_Tandjong_Priok_West-Java_TMnr_10001263-640x673.jpg 640w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-COLLECTIE_TROPENMUSEUM_Inschepen_van_pelgrims_op_weg_naar_Mekka_in_de_haven_van_Tandjong_Priok_West-Java_TMnr_10001263.jpg 666w\" alt=\"\" width=\"640\" height=\"673\">\r\n<p class=\"wp-caption-text\">Jemaah haji berdagang dan belajar ilmu agama via commons.wikimedia.org</p>\r\n</div>\r\n<h3> </h3>\r\n<h3>3. Pada tahun 1825, pemerintah kolonial Belanda mengeluarkan peraturan yang mengharuskan jemaah haji dari pulau Jawa membayar sejumlah uang untuk mendapatkan izin berangkat haji. Pun harus menggunakan kapal Belanda</h3>\r\n<div id=\"attachment_534633\" class=\"wp-caption aligncenter\"><img class=\"size-medium wp-image-534633\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-kapal-kongsi-tiga-naik-haji-1-640x570.jpg\" sizes=\"(max-width: 640px) 100vw, 640px\" srcset=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-kapal-kongsi-tiga-naik-haji-1-640x570.jpg 640w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-kapal-kongsi-tiga-naik-haji-1-768x684.jpg 768w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-kapal-kongsi-tiga-naik-haji-1-750x668.jpg 750w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-kapal-kongsi-tiga-naik-haji-1.jpg 791w\" alt=\"\" width=\"640\" height=\"570\">\r\n<p class=\"wp-caption-text\">Jemaah haji menggunakan kapal kongsi tiga milik Belanda via umroh.travel</p>\r\n</div>\r\n<h3> </h3>\r\n<h3>4. Peraturan tentang ibadah haji diubah pada tahun 1831. Calon jemaah haji yang tidak membayar uang jalan, akan dikenakan biaya dua kali lipat sekembalinya di tanah air</h3>\r\n<div id=\"attachment_534623\" class=\"wp-caption aligncenter\"><img class=\"size-medium wp-image-534623\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-Jemaah-Haji-baru-tiba-di-Pulau-Onrust-640x369.jpg\" sizes=\"(max-width: 640px) 100vw, 640px\" srcset=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-Jemaah-Haji-baru-tiba-di-Pulau-Onrust-640x369.jpg 640w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-Jemaah-Haji-baru-tiba-di-Pulau-Onrust.jpg 663w\" alt=\"\" width=\"640\" height=\"369\">\r\n<p class=\"wp-caption-text\">Dikenakan biaya 2 kali lipat via www.kaskus.co.id</p>\r\n</div>\r\n<h3> </h3>\r\n<h3>5. Tahun 1852 peraturan kembali diubah. Surat izin atau paspor haji masih diwajibkan tapi gratis dan tidak ada denda pajak. Namun Gubernur pemerintah Belanda menginstruksikan pengawasan yang lebih ketat kepada para haji</h3>\r\n<div id=\"attachment_534619\" class=\"wp-caption aligncenter\"><img class=\"size-medium wp-image-534619\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-gahetna-141125-19-640x445.jpg\" sizes=\"(max-width: 640px) 100vw, 640px\" srcset=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-gahetna-141125-19-640x445.jpg 640w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-gahetna-141125-19-768x534.jpg 768w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-gahetna-141125-19-750x522.jpg 750w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-gahetna-141125-19.jpg 891w\" alt=\"\" width=\"640\" height=\"445\">\r\n<p class=\"wp-caption-text\">Pengecekan identitas calon jemaah haji oleh pemerintah Belanda via indonesia-zaman-doeloe.blogspot.co.id</p>\r\n</div>\r\n<h3> </h3>\r\n<h3>6. Karena terjadi pemberontakan di India, tahun 1859 dibuatlah peraturan baru; paspor haji gratis, namun calon haji harus membuktikan mereka punya biaya pulang pergi dan biaya untuk keluarga yang ditinggalkan</h3>\r\n<div id=\"attachment_534626\" class=\"wp-caption aligncenter\"><img class=\"size-medium wp-image-534626\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-berangkat-haji-dari-teluk-bayur-640x369.jpg\" sizes=\"(max-width: 640px) 100vw, 640px\" srcset=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-berangkat-haji-dari-teluk-bayur-640x369.jpg 640w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-berangkat-haji-dari-teluk-bayur-768x442.jpg 768w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-berangkat-haji-dari-teluk-bayur-750x432.jpg 750w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-berangkat-haji-dari-teluk-bayur.jpg 861w\" alt=\"\" width=\"640\" height=\"369\">\r\n<p class=\"wp-caption-text\">Pengawasan lebih ketat via www.tvhaji.net</p>\r\n</div>\r\n<h3> </h3>\r\n<h3>7. Ibadah haji untuk jemaah Indonesia pernah dihentikan pada tahun 1947 berdasarkan fatwa yang dikeluarkan oleh pimpinan Majelis Syuro Muslimin Indonesia (Masyumi) menyusul situasi genting di Indonesia pasca kemerdekaan</h3>\r\n<div id=\"attachment_534627\" class=\"wp-caption aligncenter\"><img class=\"size-medium wp-image-534627\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-kampanye-partai-Masyumi-1-640x418.jpg\" sizes=\"(max-width: 640px) 100vw, 640px\" srcset=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-kampanye-partai-Masyumi-1-640x418.jpg 640w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-kampanye-partai-Masyumi-1-768x501.jpg 768w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-kampanye-partai-Masyumi-1-750x489.jpg 750w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-kampanye-partai-Masyumi-1.jpg 1200w\" alt=\"\" width=\"640\" height=\"418\">\r\n<p class=\"wp-caption-text\">Sempat dihentikan oleh Masyumi via wawasansejarah.com</p>\r\n</div>\r\n<h3> </h3>\r\n<h3>8. Tahun 1948, setelah Indonesia merdeka, K.H Moh. Adnan sebagai delegasi Indonesia bertemu dengan Raja Arab Saudi, Ibnu Saud. Sejak saat itu penyelenggaran haji Indonesia resmi dilakukan oleh Pemerintah Republik Indonesia</h3>\r\n<div id=\"attachment_534629\" class=\"wp-caption aligncenter\"><img class=\"size-medium wp-image-534629\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-pulang-dari-naik-haji-1-640x427.jpg\" sizes=\"(max-width: 640px) 100vw, 640px\" srcset=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-pulang-dari-naik-haji-1-640x427.jpg 640w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-pulang-dari-naik-haji-1.jpg 698w\" alt=\"\" width=\"640\" height=\"427\">\r\n<p class=\"wp-caption-text\">Resmi dibuka kembali pasca kemerdekaan via padangkita.com</p>\r\n</div>\r\n<h3> </h3>\r\n<h3>9. Tahun 1952, pemerintah RI melalui Menteri Agama membentuk  perusahaan Pelayaran Muslim untuk memfasilitasi transportasi umat Islam yang akan melakukan ibadah haji. Pada tahun yang sama, akses jalur udara dari Indonesia menuju Mekkah pun resmi dibuka</h3>\r\n<div id=\"attachment_534630\" class=\"wp-caption aligncenter\"><img class=\"size-full wp-image-534630\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-pilgrims_on_ship_464x597.jpg\" alt=\"\" width=\"622\" height=\"800\">\r\n<p class=\"wp-caption-text\">Fasilitas transportasi haji oleh pemerintah via www.cheria-travel.com</p>\r\n</div>\r\n<h3> </h3>\r\n<h3>10. Di tahun 1964 dibentuk perusahaan pelayaran dibawah bendera PT Arafat, satu-satunya transportasi laut milik pemerintah yang menangani masalah angkutan jemaah haji. Jamaah haji saat itu lebih memilih menggunakan kapal laut karena dinilai lebih terjangkau harganya ketimbang pesawat udara</h3>\r\n<div id=\"attachment_534631\" class=\"wp-caption aligncenter\"><img class=\"size-medium wp-image-534631\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-333499_kapal-gung-djati-_663_382-640x369.jpg\" sizes=\"(max-width: 640px) 100vw, 640px\" srcset=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-333499_kapal-gung-djati-_663_382-640x369.jpg 640w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-333499_kapal-gung-djati-_663_382.jpg 663w\" alt=\"\" width=\"640\" height=\"369\">\r\n<p class=\"wp-caption-text\">Kapal Arafat siap mengangkut jemaah haji via www.viva.co.id</p>\r\n</div>\r\n<h3> </h3>\r\n<h3>11. Namun mendekati tahun 1970-an, pesawat udara lebih mendominasi karena biayanya yang tidak jauh berbeda dengan kapal laut</h3>\r\n<div id=\"attachment_534634\" class=\"wp-caption aligncenter\"><img class=\"size-medium wp-image-534634\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-P_20150509_103343_1-640x424.jpg\" sizes=\"(max-width: 640px) 100vw, 640px\" srcset=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-P_20150509_103343_1-640x424.jpg 640w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-P_20150509_103343_1-768x508.jpg 768w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-P_20150509_103343_1-750x496.jpg 750w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-P_20150509_103343_1.jpg 1600w\" alt=\"\" width=\"640\" height=\"424\">\r\n<p class=\"wp-caption-text\">Moda pesawat udara mulai mendominasi via mascengkuek.blogspot.co.id</p>\r\n</div>\r\n<h3> </h3>\r\n<h3>12. Akhirnya, pada tahun 1969 pihak pemerintah mengambil alih penanganan penyelenggaraan haji berdasarkan keputusan presiden nomor 22 tahun 1969</h3>\r\n<div id=\"attachment_534638\" class=\"wp-caption aligncenter\"><img class=\"size-medium wp-image-534638\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-soeharto-01-640x424.jpg\" sizes=\"(max-width: 640px) 100vw, 640px\" srcset=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-soeharto-01-640x424.jpg 640w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-soeharto-01-768x509.jpg 768w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-soeharto-01-750x497.jpg 750w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-soeharto-01.jpg 1600w\" alt=\"\" width=\"640\" height=\"424\">\r\n<p class=\"wp-caption-text\">Penyelenggaraan haji diatur pemerintah via www.hmsoeharto.id</p>\r\n</div>\r\n<h3> </h3>\r\n<h3>13. Pada 1979, Menteri Perhubungan meniadakan pengangkutan jemaah dengan kapal laut dan menetapkan pesawat udara sebagai transportasi satu-satunya menuju tanah suci</h3>\r\n<div id=\"attachment_534639\" class=\"wp-caption aligncenter\"><img class=\"size-medium wp-image-534639\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-1200px-Garuda_Indonesian_Airways_Douglas_DC-8-55_Gilliand-640x427.jpg\" sizes=\"(max-width: 640px) 100vw, 640px\" srcset=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-1200px-Garuda_Indonesian_Airways_Douglas_DC-8-55_Gilliand-640x427.jpg 640w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-1200px-Garuda_Indonesian_Airways_Douglas_DC-8-55_Gilliand-768x512.jpg 768w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-1200px-Garuda_Indonesian_Airways_Douglas_DC-8-55_Gilliand-750x500.jpg 750w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-1200px-Garuda_Indonesian_Airways_Douglas_DC-8-55_Gilliand.jpg 1200w\" alt=\"\" width=\"640\" height=\"427\">\r\n<p class=\"wp-caption-text\">Penetapan pesawat udara sebagai transportasi haji via id.wikipedia.org</p>\r\n</div>\r\n<h3> </h3>\r\n<h3>14. Pada tahun 1999, dikeluarkan Undang-Undang No. 17 Tahun 1999 yang mengatur penyelenggaraan ibadah haji, termasuk perlindungan, pelayanan, dan pembinaan jemaah haji. Sejak saat itu, kuota keberangkatan jemaah haji Indonesia relatif meningkat</h3>\r\n<div id=\"attachment_534640\" class=\"wp-caption aligncenter\"><img class=\"size-medium wp-image-534640\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-haji-640x427.jpg\" sizes=\"(max-width: 640px) 100vw, 640px\" srcset=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-haji-640x427.jpg 640w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-haji-768x512.jpg 768w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-haji-750x500.jpg 750w\" alt=\"\" width=\"640\" height=\"427\">\r\n<p class=\"wp-caption-text\">Kuota jemaah haji semakin meningkat via yusepharyatno.wordpress.com</p>\r\n</div>\r\n<h3> </h3>\r\n<h3>15. Setelah era reformasi, pelayanan dan perlindungan bagi jemaah makin membaik. Kredibilitas panitia haji pemerintah diuji pada tahun 2004 dan 2006</h3>\r\n<div id=\"attachment_534641\" class=\"wp-caption aligncenter\"><img class=\"size-medium wp-image-534641\" src=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-photo-haji2015-640x427.jpg\" sizes=\"(max-width: 640px) 100vw, 640px\" srcset=\"https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-photo-haji2015-640x427.jpg 640w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-photo-haji2015-768x512.jpg 768w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-photo-haji2015-750x500.jpg 750w, https://cdn-image.hipwee.com/wp-content/uploads/2017/08/hipwee-photo-haji2015.jpg 1150w\" alt=\"\" width=\"640\" height=\"427\">\r\n<p class=\"wp-caption-text\">Pelayanan semakin membaik via www.garuda-indonesia.com</p>\r\n</div>\r\n<p>Perubahan tersebut membawa perbaikan pada penyelenggaraan haji Indonesia hingga kini. Masyarakat muslim di Indonesia semakin dimanja dengan pelayanan dan perlindungan yang jauh lebih baik, serta diberikan kemudahan dengan biaya yang relatif murah. Namun meski telah mengalami perkembangan yang signifikan, penyelenggaraan haji Indonesia bukan berarti lepas dari masalah. Hal ini sudah sepatutnya jadi perhatian pemerintah untuk upaya perbaikan baik dari segi pelayanan maupun perlindungan terhadap calon jemaah haji Indonesia.</p>\r\n<p>\"></p>', 1),
(6, '11 Hal Tentang Masjid Nabawi yang Mungkin Kamu Belum Tahu', '', '1522751226_Masjid-Nabawi-Al-Madinah.jpg', '2018-04-03 18:27:06', 0, 3, '<p xss=removed><strong>Madinah</strong> - Salah satu tempat ibadah cantik yang paling disucikan umat Muslim dunia adalah Masjid Nabawi di Madinah. Di balik kecantikannya, terselip berbagai hal menarik.<br><br>Masjid Nabawi di Madinah, Arab Saudi merupakan salah satu masjid yang didirikan oleh Nabi Muhammad SAW. Seperti yang telah banyak diketahui, masjid ini menjadi terbesar kedua di dunia setelah Masjidil Haram di Mekkah. Rumah ibadah tersebut juga merupakan tujuan bagi umat yang ingin ziarah ke makam Nabi Muhammad SAW dan para sahabat.<br><br>Selain kedua fakta tersebut, ada informasi-informasi lain yang membuat masjid ini begitu istimewa. Dikumpulkan detikTravel dari berbagai sumber, Kamis (9/6/2016), inilah 11 hal menarik tentang Masjid Nabawi yang mungkin traveler belum tahu:<br><br></p>\r\n<div id=\"beacon_1b678071ea\" xss=removed><img src=\"https://newrevive.detik.com/delivery/lg.php?bannerid=0&campaignid=0&zoneid=750&loc=https://travel.detik.com/travel-news/d-3229596/11-hal-tentang-masjid-nabawi-yang-mungkin-kamu-belum-tahu&referer=https://www.google.co.id/&cb=1b678071ea\" alt=\"\" width=\"0\" height=\"0\"></div>\r\n<p xss=removed><strong>1. Faktor unta Nabi Muhammad SAW</strong><br><br>Sebelum menjadi masjid yang begitu besar seperti sekarang, dahulu Nabawi merupakan lahan kosong dengan sejumlah pohon kurma yang tumbuh di atasnya. Lokasi pembangunan masjid ini merupakan tempat pemberhentian pertama unta yang ditunggangi Rasulullah ketika tiba di Madinah.<br><br><strong>2. Pernah terbakar api</strong><br><br>Beberapa ratus tahun setelah didirikan, Masjid Nabawi sempat terbakar. Api yang berkobar menghancurkan atap, tiang masjid hingga dinding pembatas makam Nabi Muhammad SAW. Tapi kemudian, rumah suci itu segera direnovasi oleh para pemimpin negara Muslim.<br><br><strong>3. Tempat pertama yang dialiri listrik di Jazirah Arab</strong><br><br>Ketika Kerajaan Ottoman memperkenalkan listrik di Jazirah Arab, tempat pertama yang menikmati listrik merupakan Masjid Nabawi. Masjid ini mulai menyala sekitar tahun 1909.<br><br><strong>4. Kini ukuran masjid lebih luas dari kota kuno Madinah</strong><br><br>Saat pertama kali dibangun oleh Rasulullah, Masjid Nabawi berukuran sekitar 50 meter x 50 meter. Namun seiring perkembangan zaman, serta makin banyak jamaah yang datang, masjid terus diperluas.<br><br>Kini luasnya mencapai lebih dari 100 ribu meter persegi. Masjid Nabawi sendiri sekarang bahkan berkali-kali lipat lebih luas dari Kota Madinah di masa lampau. Ukurannya adalah makam Baqi yang pada masa nabi disebut ada di pinggir Madinah, tapi sekarang lokasinya sudah dekat dengan Masjid Nabawi.<br><br><strong>5. Ada makam kosong di ruang Nabi</strong><br><br>Adanya makam kosong yang berdekatan dengan lokasi Nabi Muhammad SAW dan para sahabat dikebumikan ini telah lama melegenda. Kabar mengenai makam kosong itu sebenarnya disiapkan untuk Nabi Isa AS pun masih simpang siur.<br><br><strong>6. Kubah masjid dulunya sempat berwarna ungu</strong><br><br>Kubah terkenal di Masjid Nabawi pernah dicat berwarna ungu sekitar 150 tahun lalu. Ungu dipilih karena kabarnya warga Arab di wilayah Hijaz menyukai warna tersebut.<br><br><strong>7. Punya tiga mihrab</strong><br><br>Mihrab merupakan bagian dari masjid yang dipakai imam untuk memimpin salat. Biasanya masjid mempunyai 1 mihrab saja, tapi tidak dengan Nabawi. Ada tiga mihrab di sana.<br><br>Satu mihrab yang kini digunakan sang imam pemimpin salat berjamaah. Mihrab lainnya adalah Suleymaniye yang dibangun atas perintah Sultan Suleyman untuk imam Hanafi memimpin solat. Sedangkan satu lagi adalah mihrab untuk imam Maliki yang dulunya sering ditempati Rasulullah untuk memimpin salat.<br><br><strong>8. Isi barang di kamar Fatimah kini ada di Istanbul</strong><br><br>Barang-barang milik Nabi Muhammad SAW dulu disimpan di dalam kamar Fatimah. Ketika Madinah dikepung saat Perang Dunia I, panglima Ottoman memerintahkan untuk memindahkan barang tersebut ke Istanbul. Sekarang benda-benda dari kamar fatimah bisa dilihat di Museum Topkapi di Istanbul, Turki.<br><br><strong>9. Banyak tanda rahasia</strong><br><br>Ternyata, beberapa sisi Masjid Nabawi memiliki tanda rahasia. Beberapa pilar ditandai secara khusus untuk mengingatkan tempat itu di masa lalu adalah lokasi yang penting. Banyak jamaah yang tidak mengetahui hal ini.<br><br><strong>10. Payung raksasa dibuat dengan kerjasama perusahaan Jerman dan Jepang</strong><br><br>Di pelataran Masjid Nabawi ada puluhan payung raksasa yang otomatis terbuka sebelum adzan subuh dan tertutup menjelang magrib. Payung-payung itu ditempatkan pada 2010 sebagai proyek Medina Haram.<br><br>Proyek tersebut melibatkan berbagai pihak termasuk arsitek SL-Rasch, Menteri Perekonomian Arab Saudi, pabrik payung Jerman yaitu Liebherr serta perusahaan Jepang bernama Taiyo Kogyo.<br><br><strong>11. Pita yang bisa menurunkan suhu</strong><br><br>Pada pinggir payung raksasa, ada pita biru yang mengelilinginya. Pita itu terbuat dari material khusus, di mana si pita bisa membuat suhu di bawahnya turun 8 derajat Celcius secara otomatis. Di tengah suhu sekitar yang bisa mencapai 45 derajat, tak heran banyak jamaah yang senang berlindung di bawah payung-payung itu.</p>', 1),
(8, 'Sejarah Kota Mekah ', '', '1522808751_Sejarah-Kota-Mekah-12.jpg', '2018-04-04 10:25:51', 0, 3, '<p> </p>\r\n<p>“Sesungguhnya rumah yang mula-mula dibangun untuk (tempat beribadat) manusia, ialah Baitullah yang di Bakkah (Mekah) yang diberkahi dan menjadi petunjuk bagi semua manusia.” (QS. Ali Imran: 96)</p>\r\n<p class=\"arab\"> </p>\r\n<p>Dan (ingatlah), ketika Kami memberikan tempat kepada Ibrahim di tempat Baitullah (dengan mengatakan): “Janganlah kamu memperserikatkan sesuatupun dengan Aku…” (QS. Al-Hajj: 26)</p>\r\n<p class=\"arab\"> </p>\r\n<p>Dan (ingatlah), ketika Ibrahim meninggikan (membina) dasar-dasar Baitullah bersama Ismail (seraya berdoa): “Ya Tuhan kami terimalah daripada kami (amalan kami), sesungguhnya Engkaulah Yang Maha Mendengar lagi Maha Mengetahui”. (QS. Al-Baqarah: 127)</p>\r\n<p>Ayat pertama menjelaskan bahwa rumah pertama dibangun untuk manusia adalah rumah yang berada di Bakkah atau Mekah, sedangkan Nabi Ibrahim bukanlah manusia pertama otomatis rumah pertama tersebut bukan dibangun oleh beliau. Adapun kedua dan ketiga mengisyaratkan bahwa Nabi Ibrahim dan Ismail ‘<em>alaihimassalam</em> bukanlah orang pertama yang membangun Ka’bah, keduanya hanya meninggikan bangunan tersebut.</p>\r\n<p>Dengan demikian –menurut orang-orang yang memegang pendapat yang kedua-, Mekah sudah dimakmurkan sebelum Nabi Ibrahim memakmurkannya, bahkan ada yang mengatakan Mekah memiliki fase-fase yang berbeda di setiap zamannya. Kota tersebut pernah menjadi kota yang hijau ditumbuhi tanaman dan juga mengalami masa-masa kegersangan. Oleh karena itu, Mekah disebut <em>ummul</em> <em>qura</em>, ibunya negeri-negeri.</p>\r\n<p>Kesimpulannya, kedua pendapat ini adalah buah dari analisis yang masing-masing memiliki argumentasi, bisa jadi yang pertama benar dan yang kedua salah, demikian juga sebaliknya. Keduanya memiliki kemungkinan benar.</p>\r\n<p><strong>Masa Nabi Ibrahim Menetap di Mekah</strong></p>\r\n<p>Nabi Ibrahim mengajak keluarganya menuju ke Mekah, lalu atas perintah Allah beliau meninggalkan istrinya, Hajar, bersama anaknya yang masih kecil bernama Ismail di lembah yang kering berbatu tersebut. Setelah beberapa tahun Nabi Ibrahim kembali ke Mekah. Beliau melihat lembah tersebut telah berubah; di sana sudah terdapat sumber air, dan ada masyarakat ikut tinggal di sana bersama istri dan anaknya, yakni kabilah Jurhum. Anaknya Ismail sudah beranjak tumbuh dan membaur bersama masyarakat. Mekah pun menjadi tempat orang-orang asing singgah dan cahaya agama muncul di sana.</p>\r\n<p>Setelah itu, Nabi Ibrahim dan Ismail diperintahkan untuk membangun atau mengembalikan keadaan Bait al-Haram sebagaimana sedia kala. Ketika bangunan itu sempurna, Nabi Ibrahim diperintahkan menyeru manusia untuk berhaji ke Bait al-Haram. Dengan demikian semaraklah kota tersebut dan terkenal di kalangan masyarakat Arab.</p>\r\n<p>Perintah Allah dan tujuan menetapkan keluarganya di Mekah telah Nabi Ibrahim tunaikan, beliau pun meninggalkan kota tersebut dengan mengamanatinya kepada anaknya Ismail.</p>\r\n<p><strong>Masa Antara Nabi Ismail dan Qushay (Quraisy)</strong></p>\r\n<p><strong>1.      Masa Nabi Ismail</strong></p>\r\n<p>Nabi Ismail <em>‘alaihissalam</em> hidup selama 130 tahun. Dalam rentang waktu satu abad tersebut, beliau mengalami dua kali pernikahan. Istri pertama dari kabilah Qathura dan yang kedua dari Jurhum. Ayahnya, Nabi Ibrahim, pernah datang ke rumah Nabi Ismail di Hijaz akan tetapi mereka belum berjumpa pada saat itu, Nabi Ibrahim hanya berjumpa dengan istri dari anaknya ini. Mendengar banyak keluhan dari sang menantu, akhirnya Nabi Ibrahim memerintahkan putranya Ismail untuk menceraikan istrinya. Lalu menikahlah Nabi Ismail dengan wanita dari kabilah Jurhum.</p>\r\n<p>Nabi Ismail dianugerahi 12 orang anak buah dari pernikahannya dengan wanita Jurhum. Anak-anak Nabi Ismail ditugasi untuk merawat Ka’bah, mengajarkan manasik haji, dan mendidik para jamaah haji dengan ajaran tauhid. Ada yang mengatakan bahwa anak-anaknya ini termasuk dari kalangan nabi namun bukan rasul.</p>\r\n<p>Sepeninggal Nabi Ismail, penjagaan Baitullah al-Haram diamanatkan kepada putranya Nabit. Setelah itu para sejarawan berselisih pendapat apakah Nabit menguasai daerah ini hingga wafatnya atau ia serahkan kepada paman-pamannya dari kabilah Jurhum.</p>\r\n<p><strong>2.      Jurhum Menguasai Mekah</strong></p>\r\n<p>Ibnu Hisyam menjelaskan dalam sirahnya, bahwa yang memerintah Mekah adalah dua kabilah besar, Jurhum dan Qathura. Jurhum memerintah wilayah utara Hijaz dan Qathura mengatur wilayah Selatannya. Keadaan demikian terus berlangsung hingga terjadi perselisihan antara dua kabilah ini yang mengakibatkan peperangan. Untuk memecah kebuntuan dan mengakhiri konflik, akhirnya dua kelompok ini mengadakan perundingan, hasilnya Jurhum menjadi kabilah yang memimpin Mekah.</p>\r\n<p>Setelah lama berkuasa, mulailah kecongkakan dan sifat sewenang-wenang muncul di tengah orang-orang Jurhum. Mereka mulai lalai dalam mengurus Baitullah al-Haram, berbuat sewenang-wenang terhadap para peziarah yang berkunjung ke sana, bahkan melakukan perbuatan keji di dalam atau di dekat Baitullah al-Haram. Dua buah berhala yang bernama Isaf dan Nailah adalah sepasang manusia yang melakukan perbuatan keji di dekat al-Haram. Walaupun kisah mereka diriwayatkan dari tukang cerita, akan tetapi setidaknya hal itu menggambarkan situasi masyarakat Mekah saat itu.</p>\r\n<p><strong>3.      Jurhum Diusir dan Khuza’ah Berkuasa</strong></p>\r\n<p>Berita-berita tentang kezaliman yang dilakukan oleh kabilah Jurhum membuat kabilah-kabilah lainnya pun mulai meresponnya. Lalu berserikatlah bani Abdu Manat dengan Khuza’ah untuk menggulingkan Jurhum dari tahta mereka. Peperangan pun tak dapat dielakkan lagi, Jurhum tak mampu mengatasi sekutu Bani Abdu Manat dan Khuza’ah. Akhirnya mereka pun terusir dari Mekah setelah mendiami tempat tersebut selama beberapa generasi.</p>\r\n<p>Setelah kepergian Jurhum, kekuasaan Mekah dipegang oleh kabilah Khuza’ah. Ada yang menyatakan Khuza’ah berkuasa di Mekah selama 500 tahun, ada pula yang mengatakan 800 tahun, Allahu a’lam berapa tahun pastinya kabilah ini memegang tanggung jawab atas Baitullah al-Haram.</p>\r\n<p>Salah seorang tokoh Khuza’ah yang paling terkenal adalah Amr bin Luhai al-Khuza’i. Amr adalah orang pertama yang membawa berhala-berhala menuju Baitullah al-Haram dan mengubah agama tauhid yang dibawa oleh Nabi Ibrahim dan Ismail.. Rasulullah shallallahu ‘alaihi wa sallam bersabda tentang Amr bin Luhai,</p>\r\n<p>“Aku melihat Amr bin Amr bin Luhai mengeluarkan ususnya di neraka dan ia adalah orang pertama yang membuat-buat ajaran al-sayaaib (onta yang tidak boleh diberikan beban dan dikhususkan untuk nadzar sehingga dilepas makan dan minum apa saja dan tidak ditunggangi).” (HR. Bukhari, no. 3260).</p>\r\n<p><br><br></p>\r\n<p>\"></p>', 1);
