INSERT INTO `t_pembimbing` (`id`, `nama`, `tanggal_lahir`, `tempat_lahir`, `foto_profile`, `riwayat_pendidikan`) VALUES
(1, 'Ustadz Yazid bin Abdul Qadir Jawas', '1977-06-29', 'Kota Karanganyar, Kebumen', 'Ustadz_Yazid.jpg', 'Yazid Jawas sangat menonjol dalam kelimuan sejak usia mudanya. Dia mampu ??menghafal? kitab Bulughul Maram karangan Ibnu Hajar Al \'Asqalani diluar kepala. Dia yang sempat berguru kepada Syaikh Muhammad bin Shalih Al Utsaimin di Unaizah, juga diizinkan mengikuti ?kelas? khusus di majelis syaikh, dan juga sebagaimana dikisahkan oleh murid-murid Yazid Jawas, bahwa dia selalu meluangkan waktu minimal 2 sampai 4 jam setiap harinya atau bahkan lebih dari itu untuk membaca? kitab-kitab ilmu Islam yang bermanfaat. Ia juga pernah belajar dengan seorang profesor dari Arab Saudi yang bernama Prof. Dr. Syakh Abdurrazzaq, seorang dosen Universitas Jami’ah Al-Islamiyah Madinah.\r\n\r\nYazid Jawas saat ini membina sebuah pondok pesantren di bilangan Dramaga, Bogor, yaitu pondok pesantren Minhajus Sunnah[1]. Selain sibuk dengan aktifitas mengajar para santri di pondok, dia juga aktif menjadi narasumber di Radio Rodja dan mengisi pengajian rutin dan tabligh akbar di berbagai kota di Indonesia. Bahkan Ustadz Yazid Jawas mengisi pengajian di luar Indonesia, diantaranya pengajian tahunan bagi warga Muslim di Kobe, Jepang,[2] dan juga beberapa kali mengadakan tabligh akbar di Malaysia.[3]\r\n\r\nSelain berdakwah lewat ceramah dan tabligh akbar, dia juga aktif menelurkan berbagai karya tulis Islami hingga sekarang.\r\n\r\nBuku \"Prinsip Dasar Islam Menurut Al-Qur’an dan As-Sunnah\", penerbit Pustaka At-Taqwa\r\nBuku \"Jalan Kebahagiaan Keselamatan Keberkahan\", penerbit Media Tarbiyah\r\nBuku \"Jihad Dalam Syariat Islam dan Penerapannya di Masa Kini\", penerbit Pustaka Imam Asy-Syafi’i\r\nBuku \"Waktumu Dihabiskan Untuk Apa?\", penerbit Pustaka At-Taqwa\r\nBuku \"Panduan Shalat Jum’at Keutamaan Adab\", penerbit Pustaka At-Taqwa\r\nBuku \"Sebaik-Baik Amal Adalah Shalat\", penerbit Pustaka At-Taqwa\r\nBuku \"Sifat Wudhu dan Shalat Nabi\", penerbit Pustaka Imam Asy-Syafi’i\r\nBuku \"Syarah Aqidah Wasithiyah Prinsip Aswaja\", penerbit Media Tarbiyah\r\nBuku \"Istiqamah Konsekuen Konsisten Menetapi Jalan Ketaatan\", penerbit Pustaka At-Taqwa\r\nBuku \"Haramnya Darah Seorang Muslim\", penerbit Media Tarbiyah\r\nBuku \"Taubat Kewajiban Seumur Hidup\", penerbit Media Tarbiyah\r\nBuku \"Prinsip-Prinsip Aqidah Ahlus Sunnah Wal Jamaah\", penerbit Pustaka At-Taqwa\r\nBuku \"Jihad Dalam Syari\'at Islam\", penerbit Pustaka At-Taqwa\r\nBuku \"Panduan Keluarga Sakinah\", penerbit Pustaka Imam Asy-Syafi’i\r\nBuku \"Ritual Sunnah Setahun\", penerbit Media Tarbiyah\r\nBuku \"Kiat-Kiat Islam Mengatasi Kemiskinan\", penerbit Pustaka At-Taqwa\r\nBuku \"Kupas Tuntas Memahami Kalimat Syahadat\", penerbit Media Tarbiyah\r\nBuku \"Fiqih Shalat Berdasarkan Al-Quran dan As-Sunnah\", penerbit Media Tarbiyah\r\nBuku \"Sifat Shalawat Nabi\", penerbit Salwa Press\r\nBuku \"Mulia Dengan Manhaj Salaf\", penerbit Pustaka At-Taqwa\r\nBuku \"Syarah Kitab Tauhid\", penerbit Pustaka Imam Asy-Syafi\'i\r\nBuku \"Syarah Aqidah Ahlus Sunnah wal Jama\'ah\", penerbit Pustaka Imam Asy-Syafi\'i\r\nBuku \"Syarah Arba\'in An Nawawi\", penerbit Pustaka Imam Asy-Syafi\'i\r\nBuku \"Hukum Lagu, Musik dan Nasyid\", penerbit Pustaka At-Taqwa'),
(2, 'Ustadz Firanda Andirja', '1979-10-28', 'Surabaya', 'Ustadz Firanda Andirja.jpg', 'Belajar agama selama 20 tahun di Madinah. Dibimbing langsung oleh Ulama Besar, di antaranya Syaikh Prof. Abdurrazaq Al Badr. Diangkat oleh Arab Saudi sebagai pengajar resmi di Masjid Nabawi. Kedalaman ilmu agama yang beliau miliki membuatnya menjadi Ustadz yang paling direkomendasikan oleh sesama asatidz. Simak: 12 Fakta tentang Ustadz Firanda Andirja.'),
(3, 'Ustadz Abu Yahya Badrusalam, Lc.', '1976-04-27', 'Cileungsi, Bogor, Jawa Barat', 'Ustadz Abu Yahya Badrusalam, Lc..jpg', 'Salah seorang yang sangat berjasa dalam menebarkan dakwah sunnah ke seluruh pelosok Indonesia. Beliau adalah pembina Rodja TV, TV Sunnah nomor 1 di Indonesia. Keilmuan hadits beliau juga tak perlu diragukan. Bahkan, beliau memiliki sanad bersambung hingga Imam Bukhari dari guru beliau, Syaikh Muhammad A\'zami.'),
(4, 'Ustadz Khalid Basalamah', '1975-05-01', 'Makassar', 'Ustadz Khalid Basalamah.png', 'Ustadz sekaligus pebisnis. Beliau pemilik dari restoran Ajwad. Santun dalam berdakwah. Mempunyai koleksi video kajian sunnah yang mencapai 900 lebih video. Berkat dakwahnya yang masif, beliau menjadi Ustadz Sunnah paling populer di Indonesia. karena banyaknya video kajian beliau yang tersebar di media. Simak: 10 Fakta tentang Ustadz Khalid Basalamah.'),
(5, 'Ustadz DR. Syafiq Riza Basalamah, MA', '1976-08-27', 'Padang', 'Ustadz DR. Syafiq Riza Basalamah, MA.jpg', 'Selalu rutin mengisi kajian di Rodja TV dan Yufid TV. Ceramah beliau banyak disenangi jama’ah dikarenakan beliau sangat pintar dalam menyampaikan materi. Banyak orang yang tergugah dan tersentuh hatinya ketika menghadiri kajian beliau. Hal inilah yang membuat kajian sunnah yang beliau isi selalu ramai didatangi banyak orang. Simak 10 Fakta tentang Ustadz Syafiq Riza Basalamah.'),
(6, 'Ustadz Ahmad Zainuddin Al Banjary', '1978-10-27', 'Ponorogo, Jawa Timur', 'Ustadz Ahmad Zainuddin Al Banjary.jpg', 'Salah seorang ustadz terbaik yang mempopulerkan istilah “dakwah sunnah” pada masyarakat Indonesia. Video ceramah beliau merupakan video yang paling sering diputar di Yufid TV, yakni sekitar 2,7 juta kali telah ditonton oleh masyarakat umum. Beliau sibuk berdakwah di Kalsel dan memiliki situs Dakwahsunnah.com'),
(7, 'Ustadz Subhan Bawazier', '1977-06-29', 'Aceh', 'Ustadz Subhan Bawazier.jpg', 'Dikenal sebagai Bikers, hal itu membuat beliau disenangi kaum muda. Tak jarang beliau mengisi kajian dengan membawa motor gede. Ceramahnya yang lucu sekaligus haru menjadikan banyak orang tertarik mendengarkan kajian sunnah beliau. Pembina dari pondok pesantren Aladzievie yang berlokasi di Bogor. Simak: 6 Fakta tentang Ustadz Subhan Bawazier.'),
(8, 'Ustadz Muhammad Abduh Tuasikal', '1984-01-24', 'Ambon', 'Ustadz Muhammad Abduh Tuasikal.jpg', 'Rumaysho.com adalah situs milik beliau. Latar belakang pendidikan S2 Teknik kimia, tidak membuat beliau buta ilmu agama. Bahkan, beliau memiliki 20 sanad kitab dari Syaikh Al Ushaimi. Beliau juga memiliki pengikut terbesar di Facebook dibandingkan ustadz sunnah lain, yakni sekitar 3,6 juta orang.'),
(9, 'Ustadz Abdurrahman Ayyub', '1980-01-24', 'Jakarta', 'Ustadz Abdurrahman Ayyub.jpg', 'Mantan petinggi Jamaah Islamiyah. Sejak mengenal sunnah, beliau bertaubat dari ideologi takfiri. Kini beliau bekerja sebagai staf BNPT. Beliau juga aktif mengisi kajian sunnah, terutama masalah penangkalan terorisme. Tak heran jika tokoh-tokoh pengusung ideologi khawarij sangat membenci beliau.'),
(10, 'Ustadz Zainal Abidin bin Syamsuddin', '1980-01-24', 'Solo', 'Ustadz Zainal Abidin bin Syamsuddin.jpg', 'Besar di kalangan masyarakat tradisional, membuat beliau sangat anti dengan dakwah sunnah. Namun, setelah hidayah menyapa, beliau menjadi seorang da’i yang sangat gencar meyebarkan sunnah dan memberantas bid’ah. Beliau juga sangat paham sejarah, dan mengarang buku ilmiah “Fakta Baru Wali Songo”.'),
(11, 'Ustadz Erwandi Tarmizi', '1980-01-24', 'Bandung', 'Ustadz Erwandi Tarmizi.JPG', 'Pengarang buku fenomenal yang berjudul “Harta Halal Haram Muamalat Kontemporer” sehingga banyak kajiannya bertemakan bahaya riba. Kepakarannya dalam masalah fikih mualamat kontemporer sudah tidak diragukan lagi, sehingga beliau diakui sebagai ulama ekonomi syariah nomor 1 di Indonesia.'),
(12, 'Ustadz Habib Salim Al Muhdor', '1980-01-24', 'Semarang', 'Ustadz Habib Salim Al Muhdor.jpg', 'Menyandang gelar Habib, karena beliau salah seorang dari keturunan Rasulullah shallallahu ‘alaihi wa sallam. Beliau mengajak masyarakat untuk kembali kepada kemurnian ajaran Islam dan meninggalkan bid’ah. Hal ini membuat banyak orang dari kalangan Habib Sufi dan Habib Syi’ah membenci beliau.'),
(13, 'Ustadz Muhammad Elvi Syam', '1980-01-24', 'Lampung', 'Ustadz Muhammad Elvi Syam.jpg', 'Pendiri Surau TV. Berasal dari Padang Japang. Bersama Ustadz Ali Musri, beliau turut menyebarkan dakwah sunnah di Ranah Minang. Sebagai Ulama Muhammadiyah, beliau aktif dalam Majelis Tarjih DPW Sumatera Barat. Beliau juga salah seorang ulama MUI. Murid beliau biasa memanggilnya \"Buya Elvi Syam\".'),
(14, 'Ustadz Muhammad Nuzul Dzikri', '1980-01-24', 'Lombok', 'Ustadz Muhammad Nuzul Dzikri.jpg', 'Cara penyampaian yang bijak selalu mengena di hati. Ustadz Sunnah yang sering sekali mengingatkan kepada jamaahnya untuk senantiasa menjaga lisan. Akhlak salafi tercermin dari kata-kata beliau yang penuh hikmah juga pada kepribadian beliau. Sehingga, kajian sunnah yang beliau isi banyak membuat orang masuk Islam.\r\n');
