INSERT INTO `t_product` (`id`, `agent_id`, `name_product`, `slugname`, `productcategory_id`, `deskripsi`, `foto`, `durasi`, `pembimbing_id`, `product_status`) VALUES
(1, 1, 'Paket Haji Khusus 2018', 'paket-haji-khusus-2018', 1, '<p>HAJIUMRAHNEWS – Gelaran Banten Expo 2018 yang akan dihelat pada 16-18 November 2018 mendatang di Indonesia Convention Exhibition (ICE) BSD City bakal diramaikan dengan hadirnya sejumlah tenant dari sektor industri pariwisata. Salah satunya adalah Gaido Travel&Tours, biro perjalanan haji khusus, umrah dan halal travel nomor 1 di Indonesia itu akan menempati booth nomor 142-143.</p>', 'gaido-haji-khusus-2018.jpg', 25, 2, 0),
(2, 1, 'Haji Reguler 2018', 'haji-reguler', 1, 'Paket Haji Reguler 2018', 'haji-reg4.jpg', 60, 1, 0),
(3, 0, 'Backpacker', 'backpacker', 4, 'Deskripsi Paket Backpacker', 'Umrah-Backpacker.jpg', 0, NULL, 0),
(4, 2, 'Paket Haji Percepatan 2018', 'paket-haji-percepatan-2018', 1, 'Menunaikan ibadah haji ini sendiri merupakan salah satu dari rukun Islam yang wajib untuk dilakukan oleh umat muslim yang ada diseluruh dunia ini. namun tentunya hanya diwajibkan bagi mereka yang mampu saja. Baik itu mampu secara fisik maupun secara financial. Sebab untuk bisa menjalani ibadah haji ini sendiri tentunya biaya naik haji yang dikeluarkan pun tidak sedikit. Apalagi kalau anda menggunakan yang namanya Paket Haji ONH Plus 2018 atau Haji Khusus, tentunya biaya paket haji onh plus yang akan anda keluarkan pun menjadi lebih besar lagi ketimbang anda hanya menggunakan paket haji yang regular saja\r\n\r\nSecara lebih ringkat program Paket Haji Percepatan 2018 tersebut sebagai berikut :\r\n\r\nHotel Makkah : Pulman Zam-Zam/Mariot/Staraf\r\nArmina : Tenda Haji Plus / Staraf\r\nHotel Madinah : Gloria / Salihiya / Staraf\r\nPesawat : Saudi Airlines / Emirates/Staraf\r\nHarga Quard : USD 14.900\r\n\r\nBiaya Haji Khusus ini sudah termasuk :\r\n\r\nTicket ekonomi internasional (PP)\r\nVisa Haji\r\nCity tour wajib : Madinah 3x, Mekkah 2x, Jeddah 1x\r\nCity tour plus madinah : percetakan alquran, museum madinah dan asmaul husna, jabal maqnet\r\nCity tour makkah : Hudaibiyah, Museum Kiswah, Peternakan Onta\r\nMotivasi, Ta\'lim & Manasih di Madinah dan Makkah\r\nMuthowif dan Guide\r\nTour Leader\r\nBus AC Executive\r\nDll\r\n\r\nSyaran Pembayaran :\r\n\r\nDP sebesar USD 7500\r\nBuku Vaksin Asli dan belum expired\r\nPassport Asli\r\nPas Photo 4 x 16 15 lembar', 'haji-percepatan-2018.jpg', 20, 2, 0),
(5, 2, 'Haji Reguler 2018 ', 'haji-reguler-2018', 1, 'Haji reguler 2018\r\n\r\nYang mana calon jamaah agar dapat terdaftar dalam kloter keberangkatan jamaah haji onh plus dengan visa resmi ini dapat mebayarkan Down Payment / tanda jadi sebesar $ 7500 untuk tahapan proses mendapatkan Visa Resmi. Jamaah dapat melakukan perjanjian dari pihak penyelenggra haji Khazzanah Tours agar mendapatkan garansi resmi 100 % apabila Visa E Haji tidak keluar maka dana akan di kembalikan penuh kepada jamaah. Dan apabila Visa keluar maka jamaah dapat segera melakukan pelunasan penuh kepada pihak penyelenggara haji onh plus. Alhamdulillah di tahun keberangkatan Haji tahun 2017 jamaah haji onh plus dengan Visa E Hajj kurang lebih 100 jamaah keluar visa nya dan dapat diberangkatkan dengan lancar aman. Daftarkanlah sekarang juga agar dapat di masukan ke dalam manifest grup rombongan kloter haji khusus onh plus.\r\n\r\nBerikut adalah jadwal/schedule Paket haji plus 2018-2019-2020 dengan kegiatan saat berada di makkah dan madinah secara terinci.', 'haji-reguler-2018.jpg', 90, 2, 0),
(6, 3, 'Paket Haji VIP', 'paket-haji-vip', 1, 'Penetapan Biaya Haji VIP\r\nPenetapan biaya Haji VIP ditentukan oleh Kementrian Agama beserta komisi VIII DPR RI. Mereka berunding dan berdiskusi untuk dapat menyepakati dan menetapkan rata-rata direct cost Biaya Penyelenggaraan Ibadah Haji untuk tahun yang akan dijalani. Hasil keputusan tentang biaya ini dapat menjadi lebih besar atau lebih kecil dari Biaya BPIH tahun sebelumnya.\r\n\r\nSetelah kesepakatan terjadi, maka mereka akan membuat atau menyiapkan draft keputusan presiden untuk segera ditandatangani presiden. Dan setelah resmi ditandatangani oleh presiden, selanjutnya adalah menetapkan Waktu Pelunasan BPIH. Penetapan ini berlaku untuk BPIH ONH Plus dan BPIH Reguler.\r\n\r\nKomponen BPIH antara lain adalah digunakan untuk membayar Ticket, Airport Tax dan passenger Service dan termasuk didalamnya adalah komponen Indirect Cost, Biaya pemondokan di Tanah Suci dan Living Allowance. Kemudian ada juga komponen biaya Indirect Cost yang dimanfaatkan untuk mengantisipasi perubahan nilai mata uang Rupiah terhadap USD dan hal-hal lainnya yang bersifat Force Majeure.\r\n\r\nHarga Paket Biaya Haji ONH PLUS Al Hijaz Indowisata\r\nHarga biaya haji plus di Travel Haji Al Hijaz pada prinsipnya mengikuti penetapan biaya haji ONH plus versi pemerintah. Dengan demikian, ongkos haji plus yang kami tampilkan tentu saja pada akhirnya akan menyesuaikan dengan keputusan hasil pemerintah. Harga haji onh plus yang kami release pada saat ini adalah sebagai berikut:\r\n\r\nHarga Paket Haji sebesar :\r\nUSD 9500 untuk paket Quard (Satu kamar ber-empat).\r\nUSD 10000 untuk paket Triple (Satu kamar ber-tiga).\r\nUSD 10500 untuk paket Double (Satu kamar ber-dua).\r\nDown Payment atau DP Haji Khusus ini adalah sebesar USD 5000.\r\nPilih Mana, Ongkos Naik Haji Plus atau Reguler?\r\nIbadah haji dapat dilakukan melalui haji reguler dan haji plus. Keduanya memiliki kelebihan dan kekurangan masing-masing. Agar lebih paham, yuk simak ulasan lengkapnya! Semakin lama waktu antrian naik haji membuat sebagian muslim merasa khawatir untuk berangkat. Bukan semata soal biaya, namun lebih ke arah faktor usia. Apalagi, sejak pengurangan kuota karena renovasi Masjidil Haram yang dilakukan oleh Pemerintah Arab Saudi, membuat kuota naik haji di Indonesia sempat terpotong. Hal ini berimbas masa antrian yang semakin panjang.\r\n\r\nSistem Antrian Haji atau SISKOHAT yang perlu menunggu bertahun-tahun ini sebenarnya berlaku untuk haji reguler. Sementara untuk menempuh siskohat yang lebih pendek bisa memanfaatkan haji plus. Namun, layaknya traveling plus, ongkos naik haji plus tentu lebih mahal dari haji reguler. Secara umum berikut perbedaan keduanya yang sebaiknya Anda ketahui saat mulai merencanakan biaya naik haji. Haji reguler dijalankan dengan mengikuti tahapan siskohat yang langsung diatur oleh pemerintah. Oleh karena peminatnya cukup besar dan kuota yang diberikan terbatas, membuat siskohat haji reguler bisa mencapai antrian hingga bertahun lamanya.\r\n\r\nDi sisi ongkos, biaya haji reguler lebih murah karena dipegang langsung oleh pemerintah, segala kebutuhan mulai persiapan saat ibadah haji berlangsung hingga proses kepulangan dikoordinasi dengan lebih menyeluruh. Jamaah Haji Reguler biasanya juga lebih akrab satu sama lain. Hal ini karena proses persiapan yang lebih lama, sehingga bisa mengakrabkan antar jamaah saat manasik haji. Kelebihan lainnya, selain biaya yang murah, haji reguler juga memiliki waktu yang lebih lama berada, yaitu sekitar 30-40 hari. Itulah sebabnya, haji reguler cocok bagi setiap muslim yang memiliki dana terbatas, namun ingin berlama-lama menunaikan ibadah sebanyak-banyaknya di tanah suci.\r\n\r\nHaji Khusus Bermula dari pelayanan haji reguler yang kurang memuaskan, beberapa Biro Penyelenggara Haji membuat haji khusus. Berbeda dengan haji reguler, fasilitas yang ditawarkan haji khusus tentu lebih premium. Mulai dari manasik haji di hotel, transit dari hotel bukan asrama haji, hingga pelayanan akomodasi di hotel berbintang dengan makanan berkualitas premium. Bahkan, bisa mendapatkan hotel yang dekat sampai yang di depan persis Masjidil Haram maupun Masjid Nabawi.', 'wisata-muslim.jpg', 25, 3, 0),
(7, 3, 'Paket Ibadah Haji Reguler', 'paket-ibadah-haji-reguler', 1, 'Jadikan perjalanan umrohmu berbeda dengan yang biasanya, dengan mengendarai moge menuju 2 kota suci di saudi.  VISA:  Kedutaan mempunyai keputusan mutlak atas pengajuan visa dan kami pihak travel tidak  bisa menentukan kepastian apakah visa bapak/ibu ditolak atau diterima. Kami pihak travel agent hanya bisa membantu  mengajukan/memproses permohonan visa tersebut sesuai prosedur dan sesuai dokumen yang diperlukan. Penolakan dokumen oleh pihak kedutaan atau revisi kelengkapan dokumen pengajuan visa merupakan keputusan pihak kedutaan, segala keterlambatan kelengkapan dokumen bukan menjadi tanggung jawab travel agent. Biaya visa tetap harus dibayarkan walaupun visa tidak disetujui oleh Kedutaan, demikian juga jika terdapat biaya lain seperti pembatalan hotel, kereta dan atau tiket pesawat yang terjadi karena adanya tenggat waktu yang belum tentu sesuai dengan waktu penyelesaian proses visa dari Kedutaan, dan juga biaya tour lainnya maka akan dibebankan kepada Peserta tour.  PERLENGKAPAN :  Perlengkapan Ibadah IDR 1.200.000  *Harga Paket/Jadwal/Program/Fasilitas dapat berubah setiap saat menurut kondisi/situasi yang berlaku pada Penerbangan/Negara setempat  *Harga untuk minimum keberangkatan 20 Peserta, dan akan disesuaikan jika tidak mencapai kuota keberangkatan minimum', 'paket-reguler.jpg', 70, 4, 0),
(8, 1, 'Marhaban Ramadhan 2018 - Ni\'mah - 09 Hari (Jakarta)', 'marhaban-ramadhan-2018', 2, 'Jadikan perjalanan umrohmu berbeda dengan yang biasanya, dengan mengendarai moge menuju 2 kota suci di saudi.', 'umrohbikers.jpg', 9, 7, 0),
(9, 2, 'Umroh bersama Ustadz Subhan Bawazier', 'umroh-bersama-ustadz-subhan-bawaier', 2, 'Biaya Visa Progresive (Jika sudah pernah umroh ditahun yang sama dikenakan Repeat Charging)\r\n\r\n*Harga dan jadwal bisa berubah sewaktu-waktu menyesuaikan kondisi penerbangan, hotel mata uang.\r\n\r\nPrice Detail\r\nQuad = IDR 30.739.499\r\nTriple = IDR 32.239.499\r\nDouble = IDR 33.739.499\r\nHotel\r\nMekah : Marriott Hotel\r\nMadinah : Royal Inn An Nuzul\r\nPenerbangan\r\nSaudi Arabian Airlines\r\nInclude\r\nAirport Tax Handling\r\nAkomodasi Hotel\r\nBagasi 20 kg\r\nManasik\r\nPerlengkapan Umroh\r\nTiket Pesawat PP\r\nTour Guide\r\nVisa\r\nExclude\r\nBiaya pribadi lainnya\r\nBiaya Visa Progresif\r\nCity Tour\r\nKelebihan berat bagasi\r\nPaspor', 'umroh-ustsubhan.jpg', 10, 7, 0),
(10, 3, 'Umroh Safir 9 Hari Jasmina', 'umroh-safir-9-hari-jasmina', 2, 'Perlengkapan Umroh Rp. 1.200.000,-\r\n\r\nBiaya Visa Progresive (Jika sudah pernah umroh ditahun yang sama dikenakan Repeat Charging)\r\n\r\n*Harga dan jadwal bisa berubah sewaktu-waktu menyesuaikan kondisi penerbangan, hotel mata uang.\r\n\r\nPrice Detail\r\nQuad = IDR 22.529.953 / USD 1.700\r\nTriple = IDR 23.197.903 / USD 1.750\r\nDouble = IDR 24.533.803 / USD 1.850\r\nHotel\r\nMekah : Riyadh Al Hijra\r\nMadinah : Al Saha\r\nPenerbangan\r\nEmirates Airlines\r\nInclude\r\nAirport Tax Handling\r\nAkomodasi Hotel\r\nBagasi 20 kg\r\nManasik\r\nTiket Pesawat PP\r\nTour Guide\r\nVisa\r\nExclude\r\nBiaya pribadi lainnya\r\nBiaya Visa Progresif\r\nCity Tour\r\nKelebihan berat bagasi\r\nPaspor\r\nPerlengkapan Umroh', 'UMROHJASMINA.jpg', 9, 7, 0),
(11, 1, '10 Days West Coast USA Muslim Tour', '10-days-west-coast-usa-muslim-tour', 3, 'Setibanya Anda akan diajak city tour melewati/mengunjungi Beverly Hills, Rodeo Drive, Hollywood Walk of Fame, TCL Chines Theatre, Dolby Theatre, Sunset Boulevard dan Mosque Al Mu’min.\r\n\r\n', '10-Days-West-Coast-USA-Muslim-Tour.jpg', 10, 8, 0),
(12, 2, '12 Days Maroco – Spain – Portugal Muslim Tour', '12-days-maroco-spain-portugal-muslim-tour', 3, 'Hari 1 \r\n\r\nJAKARTA KEBERANGKATAN\r\n2 jam sebelum keberangkatan  peserta harus sudah berkumpul di Terminal 2D Soekarno Hatta Airport guna persiapan penerbangan ke Casablanca. Peserta akan beristirahat diatas pesawat hingga kedatangan keesokan-harinya. (MOB)\r\n\r\nHari 2 \r\n\r\nCASABLANCA – MARRAKESH\r\nSetibanya di Casablanca, kita langsung diantar menyaksikan keindahan Masjid Hassan II. Kemudian bertolak selama 2 jam 35 menit berkendara menuju kota Marrakesh untuk santap malam dan check in hotel guna berisitirahat. (MS,MM)\r\n\r\nHari 3 \r\n\r\nMARRAKESH – RABAT\r\nPagi hari kita akan mengunjungi Bahia Palace, Spice Pharmacy in the Old medina, Kutubia Masjid. Setelah makan siang di Jamaa Elfnaa, anda mempunyai waktu bebas untuk berbelanja. Setelah itu kita akan menuju Rabat untuk santap malam dan menuju hotel untuk beristirahat. (MP,MS,MM)\r\n\r\nHari 4 \r\n\r\nRABAT – TANGER\r\nSetelah santap pagi dan check out hotel kita akan mengunjungi Qasbah Oudayas, Hassan Tower, Mausoleum Muhammed V. Kemudian anda mempunyai waktu bebas untuk berbelanja di Bazaar Market. Setelah makan siang kita akan menuju Tanger (+/- 4 jam ) untuk menuju hotel untuk beristirahat. (MP,MS,MM)\r\n\r\nHari 5 \r\n\r\nTANGIER – TARIFA – SEVILLA\r\nSetelah santap pagi anda menuju Spanyol dengan ferry . Jika situasi dan kondisi memungkinkan, dalam perjalanan penyeberangan tersebut kita dapat menyaksikan Kebesaran Allah SWT akan pemandangan fenomal dimana air pertemuan dari 2 samudra tak dapat menyatu. Dari atas ferry kita dapat pula menyaksikan pemandangan Rock of Gibraltar –bekas pusat pertahanan muslim pertama di Wilayah Andalucia yang berhasil ditaklukan Tariq Bin Ziyad. Semenjak Gibraltar masuk Wilayah Kekuasaan British, maka Wisatawan tidak dapat memasuki Wilayah Gibraltar tanpa Visa United Kingdom. Setibanya di Tarifa kita langsung makan siang dan melanjutkan perjalanan sambil menikmati kota Sevilla selama +/- 2 jam 20 menit. Setelah itu kita akan mengunjungi Plaza Espana, Jardines de Murillo, berbelanja di Muslim quarters dan photo stop di Giralda Tower. Usai santap malam kita akan menuju ke hotel untuk bermalam. (MP,MS,MM)\r\n\r\nHari 6 \r\n\r\nSEVILLA – LISBON\r\nPagi hari kita akan menuju Lisbon ( +/- 6 jam ), setelah makan siang di Lisbon kita akan shalat di Central Masjid of Lisbon dan mengunjungi Lisbon city Center. Photo stop di Belem Tower, Rossio Square, Jeronimos Monastery, Monument to the Discoveries serta berbelanja souvenir produk lokal.(MP,MS,MM)\r\n\r\nHari 7 \r\n\r\nLISBON – SINTRA – SEVILLE\r\nSelepas santap pagi di hotel, kita akan mengunjungi Palace National de Sintra. Shalat di Central Masjid of Lisbon. Kemudian melanjutkan perjalanan ke Seville (+/- 6 jam) untuk santap malam dan checkin hotel.  (MP,MS,MM)\r\n\r\nHari 8 \r\n\r\nSEVILLE – CORDOBA – GRANADA\r\nSetelah sarapan pagi, kita akan menuju Cordoba untuk mengunjungi Muslim quarters, Mesjid Cordoba  sampai tiba waktu makan siang. Setelah itu melanjutkan perjalanan ke Granada. Setibanya di Granada kita akan mengunjungi Albayzin Muslim Quarters, dan shalat di Granada Mosque.Dilanjutkan santap malam dan menuju hotel untuk beristirahat. (MP,MS,MM)\r\n\r\nHari 9 \r\n\r\nGRANADA – ALHAMBRA – MADRID\r\nSetelah makan pagi kita akan menuju Alhambra. Dilanjutkan perjalanan ke Madrid. (MP,MS,MM)\r\n\r\nHari 10 \r\n\r\nMADRID CITY TOUR\r\nSetelah makan pagi kita akan mengunjungi factory Outlet Las Rozas Village untuk berbelanja. Kemudian photostop di Bull fight ring, Bernabeu Stadium, Royal Palace . (MP,MS,MM)\r\n\r\nHari 11 \r\n\r\nMADRID KEBERANGKATAN – JAKARTA\r\nPagi hari setelah santap pagi acara bebas sampai tiba waktunya Anda akan diantar ke Airport guna penerbangan ke Jakarta. (MP,MOB)\r\n\r\nHari 12 \r\n\r\nJAKARTA KEDATANGAN\r\n\r\nIn Shaa Allah tiba di Jakarta, maka selesailah program wisata muslim ini. Terima kasih keikut-sertaannya. Sampai jumpa di program lainnya. (MOB) \r\n\r\nMP= Makan Pagi           MS= Makan Siang            MM= Makan Malam          MOB = Makan di Pesawat\r\n\r\nHarga :\r\n\r\nDouble : IDR 35.980.000\r\n\r\nTriple : IDR 34.980.000\r\n\r\nPenginapan :\r\n\r\nHotel *4\r\n\r\nVISA:\r\n\r\nKedutaan mempunyai keputusan mutlak atas pengajuan visa dan kami pihak travel tidak  bisa menentukan kepastian apakah visa bapak/ibu ditolak atau diterima. Kami pihak travel agent hanya bisa membantu  mengajukan/memproses permohonan visa tersebut sesuai prosedur dan sesuai dokumen yang diperlukan. Penolakan dokumen oleh pihak kedutaan atau revisi kelengkapan dokumen pengajuan visa merupakan keputusan pihak kedutaan, segala keterlambatan kelengkapan dokumen bukan menjadi tanggung jawab travel agent.\r\n\r\nNote:\r\n\r\nVisa & Asuransi Perjalanan IDR. 2.500.000\r\nTipping Driver, Local Guide, Tour Leader IDR.  1.450.000\r\n*Surcharge peak season Rp 6.000.000,-\r\n*Harga Paket/Jadwal/Program/Fasilitas dapat berubah setiap saat menurut kondisi/situasi yang berlaku pada Penerbangan/Negara setempat\r\n*Harga untuk minimum keberangkatan 20 Peserta, dan akan disesuaikan jika tidak mencapai kuota keberangkatan minimum\r\n*Harga berdasarkan rate 1 EUR = Rp 15.500,- Dan akan disesuaikan dengan kurs yang berlaku pada saat transaksi.\r\n\r\nPrice Detail\r\nIDR 34.980.000\r\nInclude\r\nAkomodasi Hotel\r\nMakan\r\nTiket Pesawat PP\r\nTransportasi\r\nExclude\r\nAsuransi perjalanan\r\nBiaya pribadi lainnya\r\nKelebihan berat bagasi\r\nPaspor\r\nTipping Guide dan Driver\r\nVisa', '12-Days-Maroco-Spain-Portugal-Muslim-Tour.jpg', 12, 9, 0),
(13, 3, '11 Days East Europe Muslim Tour', '11-days-east-europe-muslim-tour', 3, 'Hari 1\r\n\r\nJAKARTA KEBERANGKATAN   \r\n2 Jam sebelumnya peserta sudah berada di Soekarno-Hatta Airport untuk persiapan penerbangan menuju Munich, Jerman. Anda akan beristirahat diatas pesawat hingga kedatangan esok hari (MOB)\r\n\r\nHari 2\r\n\r\nMUNICH – PRAHA\r\nSetibanya di Munich, Anda akan kami ajak langsung menuju kota Praha, ibukota negara Czech Republic, dengan berkendara selama 4 jam untuk menikmati kota Praha yang indah, termasuk didalamnya Hradcany Castle yang sudah berusia lebih dari 1000 tahun, Islamic centre Praha, Old Town Square yang penuh dengan toko-toko souvenir dan café yang menjual makanan ringan khas kota Praha, Charles Bridge yang merupakan jembatan paling romantis dengan pemandangan kedua sisi kota Praha yang menawan, serta Astronomical Clock – jam unik yang sangat terkenal di seluruh Eropa dan dunia. (MS,MM)\r\n\r\nHari 3 \r\n\r\nPRAHA – BRATISLAVA – BUDAPEST\r\nPagi hari Anda akan melanjutkan perjalanan menuju Bratislava, ibukota Slovakia dengan menggunakan bus wisata selama 3,5 jam. Setibanya Anda akan diajak mengunjungi/ melewati Old town square dan Bratislava castle. Setelah itu dilanjutkan menuju kota Budapest untuk beristirahat selama 2 malam. (MP,MS,MM)\r\n\r\nHari 4\r\n\r\nBUDAPEST CITY TOUR\r\nAnda akan menikmati kota paling besar di belahan timur Eropa ini dengan melihat Parliament House, Royal Palace, Andrassy Avenue. Dan dari menara di Fishermen’s Bastion yang merupakan area dagang untuk para nelayan di jaman dahulu di Citadel Hill, Anda akan melihat keindahan panorama dari kota yang dibelah oleh Sungai Danube. Kemudian, Anda akan mengunjungi  Heroes’ Square. Shalat di masjid Budapest. (MP,MS,MM)\r\n\r\nHari 5 \r\n\r\nBUDAPEST – PANDORF FACTORY OUTLET – VIENNA\r\nHari ini perjalanan dilanjutkan selama 3 jam berkendara menuju kota Vienna, di negara  Austria. Dalam perjalanan, kita akan singgah di Pandorf Factory Outlet.  Tiba di kota Vienna  Anda akan diajak untuk mengelilingi kota ini dengan bus wisata melewati Ringstrasse, State Opera House, dan Hofburg Palace, istana musim dingin dari keluarga kerajaan Austria. Schonbrunn Palace, kompleks istana yang sangat luas akan Anda jelajahi hingga ke bagian dalamnya. Setelah makan siang, acara bebas untuk Anda yang dapat Anda pergunakan untuk berbelanja di sekitar Vienna Cathedral. Tak lupa sholat di Islamic Centre Vienna. (MP,MS,MM)\r\n\r\nHari 6 \r\n\r\nVIENNA – CESKY KRUMLOV – SALZBURG\r\nPagi hari kita akan menikmati perjalanan dengan bus wisata selama 3.5 jam dari kota Vienna menuju kota Salzburg dengan melewati Kota Cesky Krumlov yang indah, Kota yang masuk dalam warisan dunia versi UNESCO karena arsitektur bangunan nya. Setelah itu Perjalanan dilanjutkan selama 3 jam menuju kota Salzburg untuk bermalam. (MP,MS,MM)\r\n\r\nHari 7 \r\n\r\nSALZBURG – HALSTATT – SALZBURG\r\nSetelah santap pagi dihotel, anda akan city tour kota Salzburg untuk melihat Mozart’s Birthplace atau kediaman masa kecil Amadeus Mozart, komposer jenius, hingga bakatnya ditemukan di usia sangat muda. Mirabell Garden, yang merupakan tempat syuting film Sounds of Music dapat Anda kunjungi berikutnya sebelum menikmati jalan Getreidegasse yang penuh dengan café-café dan toko penjual souvenir khas Austria terutama Mozartkugeln, coklat yang hanya dapat Anda temui disini. Setelah itu Anda kami antar untuk mengagumi kota Hallstatt yang indah, dan shalat di masjid masyarakat Turki yang bermukim dikota Salzburg. (MP,MS,MM)\r\n\r\nHari 8 \r\n\r\nSALZBURG – INNSBRUCK\r\nAcara hari ini Anda akan melakukan perjalanan selama 2,5 jam berkendara menuju kota Innsbruck , kota tempat diselenggarakannya Olympiade Musim Dingin. Setibanya di Innsbruck, langsung city tour dengan melihat Old Town dan Istana Raja Maxmillian yang dikenal dengan Golden Roof. Setelah makan malam lalu menuju hotel untuk beristirahat. (MP,MS,MM)\r\n\r\nHari 9 \r\n\r\nINNSBRUCK – MUNICH\r\nSetelah makan pagi, perjalanan dilanjutkan selama 2 jam berkendara. Anda akan kami ajak untuk masuk ke BMW World dimana berbagai koleksi mobil BMW bisa Anda lihat, serta melewati Allianz Arena, Olympic Stadium sebelum ke Marienplatz untuk berbelanja. Shalat di Islamic Center Munich. (MP,MS,MM)\r\n\r\nHari 10 \r\n\r\nMUNICH  – JAKARTA\r\nSetelah santap pagi, Acara dilanjutkan dengan acara bebas. Sampai tiba waktunya Anda akan diantar menuju Airport untuk penerbangan kembali ke Jakarta. (MP)\r\n\r\nHari 11\r\n\r\nJAKARTA KEDATANGAN\r\nTiba di JAKARTA. Terima kasih keikut-sertaan Anda bersama Jasmina Experience, sampai jumpa di program lainnya.\r\n\r\nMP= Makan Pagi           MS= Makan Siang            MM= Makan Malam          MOB = Makan di Pesawat\r\n\r\nHarga :\r\n\r\nDewasa:\r\n\r\nTwin Sharing/Triple : IDR 34.980.000\r\n\r\nSingle Supplement : IDR 39.980.000\r\n\r\nAnak – anak :\r\n\r\nTwin Sharing : IDR 33.980.000\r\n\r\nPenginapan :\r\n\r\nHotel *3 & *4\r\n\r\nVISA:\r\n\r\nKedutaan mempunyai keputusan mutlak atas pengajuan visa dan kami pihak travel tidak  bisa menentukan kepastian apakah visa bapak/ibu ditolak atau diterima. Kami pihak travel agent hanya bisa membantu  mengajukan/memproses permohonan visa tersebut sesuai prosedur dan sesuai dokumen yang diperlukan. Penolakan dokumen oleh pihak kedutaan atau revisi kelengkapan dokumen pengajuan visa merupakan keputusan pihak kedutaan, segala keterlambatan kelengkapan dokumen bukan menjadi tanggung jawab travel agent. Biaya visa tetap harus dibayarkan walaupun visa tidak disetujui oleh Kedutaan, demikian juga jika terdapat biaya lain seperti pembatalan hotel, kereta dan atau tiket pesawat yang terjadi karena adanya tenggat waktu yang belum tentu sesuai dengan waktu penyelesaian proses visa dari Kedutaan, dan juga biaya tour lainnya maka akan dibebankan kepada Peserta tour.\r\n\r\nNote:\r\n\r\nVisa Schengen & Asuransi Perjalanan IDR. 2.500.000\r\nTipping Driver, Local Guide, Tour Leader IDR.  1.250.000\r\n*Surcharge peak season Rp 6.000.000,-\r\n*Harga Paket/Jadwal/Program/Fasilitas dapat berubah setiap saat menurut kondisi/situasi yang berlaku pada Penerbangan/Negara setempat\r\n*Harga untuk minimum keberangkatan 20 Peserta, dan akan disesuaikan jika tidak mencapai kuota keberangkatan minimum\r\n*Harga berdasarkan rate 1 EUR = Rp 15.500,- Dan akan disesuaikan dengan kurs yang berlaku pada saat transaksi.\r\n\r\nPrice Detail\r\nIDR 34.980.000\r\nInclude\r\nAkomodasi Hotel\r\nMakan\r\nTiket Pesawat PP\r\nTransportasi\r\nExclude\r\nAsuransi perjalanan\r\nBiaya pribadi lainnya\r\nKelebihan berat bagasi\r\nPaspor\r\nTipping Guide dan Driver\r\nVisa', '11-Days-East-Europe-Muslim-Tour.jpg', 11, 10, 0),
