(15, 2, '13 Days West Europe Muslim Tour Free Keukenhof Hol', '13-Days-West-Europe-Muslim-Tour-Free-Keukenhof-Holand', 3, 'Hari 1\r\n\r\nJAKARTA Keberangkatan                                                              \r\nSemua peserta berkumpul di Bandara International Soekarno-Hatta, Terminal 2D Keberangkatan (diharapkan tiba 3 jam sebelum keberangkatan) untuk proses check-in penerbangan dan immigrasi serta menunggu waktu boarding penerbangan ke Roma via Doha\r\n\r\nHari 2\r\n\r\nROMA  kedatangan  – VATICAN                                                                                                                                                                                                               \r\nSetibanya di Rome, Anda akan diajak mengunjungi /melewati Vatican city untuk melihat kemegahan dari St. Petter Bassilica. Kemudian city tour kota Roma dengan mengunjungi Colosseum, Roman Forum, dan air mancur Trevi Fountain yang terkenal. Setelah makan siang shalat di Mesjid Raya Kota Roma. (-, MS, MM)\r\n\r\nHari 3\r\n\r\nROMA – PISA – SESTO FIORE                                                                                       \r\nHari ini menuju obyek wisata terkenal di Italy yaitu Menara Miring Pisa yang termasuk dalam situs 7 Keajaiban Dunia. Usai city tour di kota Pisa melanjutkan perjalanan menuju Sesto Fiore . Dalam perjalanan berkesempatan untuk singgah di Pierotucci Leather Shop dimana anda akan menemukan produk-produk kulit terkenal dari Italy. (MP, MS, MM)\r\n\r\nHari 4\r\n\r\nSESTO FIORE – VENICE                                                                                                 \r\nPagi hari anda akan menuju Venice Island dengan menggunakan private water taxi untuk mengunjugi St. Marco Square , Bridge of Sighs, Doge’s Place sekaligus makan siang di local Restaurant dengan menu khas spaghetti hitam yang sangat lezat. Tak lupa menikmati Gondola yaitu perahu khas Venice Island (biaya masing-masing). Setelah makan malam bersama diantar menuju hotel untuk beristirahat.  (MP, MS, MM)\r\n\r\nHari 5\r\n\r\nVENICE – MILAN – LUCERNE                                                                                         \r\nPagi hari meninggalkan kota Venice untuk menuju Milan, Italia dengan melalui salah satu terowongan terpanjang di dunia, St. Gotard. Tiba di Milan mengunjungi Duomo Milan yang terkenal serta berkesempatan untuk singgah Galleria Vittorio Emanuel II. Usai makan siang melanjutkan perjalanan menuju Lucerne. Setibanya diajak makan malam bersama kemudian diantar ke hotel untuk beristirahat. (MP, MS, MM)\r\n\r\nHari 6\r\n\r\nLUCERNE – Mt. TITLIS – ENGELBERG –  LUCERNE                                                                                                         \r\nSetelah makan pagi di hotel, Anda akan diantar menuju desa Engelberg untuk memulai perjalanan dengan cable car menuju puncak Gunung Titlis dengan ketinggian 3020 dpl dimana anda bias menyaksikan salju abadi. Selanjutnya anda akan mengunjungi kota Lucerne, surga untuk para kolektor jam dan melihat Chapel Bridge,  Old Town & Danau Lucerne yang indah hingga waktu makan malam  dan kembali ke hotel untuk istirahat.  (MP, MS, MM) \r\n\r\nHari 7\r\n\r\nLUCERNE – SCHAFFHAUSEN – TITISEE –  STRASBOURG                                         \r\nSetelah makan pagi dan check-out hotel, perjalanan hari ini dilanjutkan menuju Schaffhausen menyaksikan keindahan Rhinefalls, air terjun terbesar di wilayah Eropa Barat. Kemudian menuju Hutan Black Forest untuk santap siang sekaligus menikmati pemandangan Danau Titisee dan kerajinan jam Cuckoo Clock. Berikutnya perjalanan dilanjutkan menuju Strasbourg. (MP, MS, MM)\r\n\r\nHari 8\r\n\r\nSTRASBOURG – PARIS                                                                                                 \r\nPagi hari anda akan diajak city tour di kota Strasbourg antara lain dengan melewati/ mengunjungi European Parliament, Place de La Republique, serta Petite France. Anda juga berkesempatan untuk sholat di Masjid Raya Strasbourg. Kemudian melanjutkan perjalanan ke kota Paris. Tiba di Paris makan malam bersama kemudian diantar ke hotel untuk beristirahat. (MP,MS, MM)\r\n\r\nHari 9\r\n\r\nPARIS CITY TOUR                                                                                                           \r\nSetelah makan pagi di hotel diajak mengunjungi Eiffel Tower untuk menikmati panorama kota Paris dari ketinggian level 2, kemudian mengunjungi Grande Mosque (Masjid Raya Paris). Setelah makan siang anda ada waktu bebas untuk berbelanja di Galeries Lafayette / toko Duty Free. (MP,MS, MM)\r\n\r\nHari 10\r\n\r\nPARIS – BRUSSELS  – AMSTERDAM                                                                              \r\nSetelah makan pagi dan check-out hotel, melanjutkan perjalanan menunju Amsterdam. Dalam perjalanan singgah di Brussels mengunjungi Maneken Pis, Royal Palace, Town Hall serta photo stop di Atominium dan sholat di Islamic Centre Brussels., kemudian melanjutkan perjalanan menuju Amsterdam untuk makan malam. (MP, MS, MM)\r\n\r\nHari 11\r\n\r\nAMSTERDAM – VOLENDAM – AMSTERDAM                                                                                               \r\nPagi hari perjalanan dimulai dengan menuju  Volendam untuk mengunjungi Traditional Fisherman Village, dimana Anda dapat berfoto dengan pakaian khas nelayan Belanda. Setelah makan siang  kemudian kembali ke kota Amsterdam untuk city tour melewati di Dam Square dan   menikmati keunikkan serta keindahan kota Amsterdam dengan Canal Cruise, kemudian diajak mengunjungi salah satu pabrik pengasahan berlian yang terkenal di dunia,  Dilanjutkan  makan malam dan kembali ke  hotel di Amsterdam untuk istirahat. (MP, MS, MM) \r\n\r\nHari 12\r\n\r\nAMSTERDAM – LISSE – AMSTERDAM                                                                            \r\nSetelah makan pagi dan check-out hotel, anda akan diantar ke kota Lisse untuk melihat pameran Bunga Tulip Keukenhoff, sampai tiba waktunya diantar menuju airport Schiphol untuk penerbangan kembali ke Tanah Air via Doha. (MP)\r\n\r\nHari 13\r\n\r\nSore hari tiba kembali di Jakarta. Terima kasih atas keikut sertaannya bersama Jasmina Experience. Semoga membawa kenangan indah yang tidak terlupakan.\r\n\r\nMP= Makan Pagi           MS= Makan Siang            MM= Makan Malam          MOB = Makan di Pesawat\r\n\r\nHarga :\r\n\r\nDewasa :\r\n\r\nTwin Share : IDR 34.980.000\r\n\r\nAnak :\r\n\r\nTwin Share : IDR 33.980.000\r\n\r\nSingle Supplement : IDR 39.980.00\r\n\r\nPenginapan :\r\n\r\nHotel *3 & *4\r\n\r\nVISA:\r\n\r\nKedutaan mempunyai keputusan mutlak atas pengajuan visa dan kami pihak travel tidak  bisa menentukan kepastian apakah visa bapak/ibu ditolak atau diterima. Kami pihak travel agent hanya bisa membantu  mengajukan/memproses permohonan visa tersebut sesuai prosedur dan sesuai dokumen yang diperlukan. Penolakan dokumen oleh pihak kedutaan atau revisi kelengkapan dokumen pengajuan visa merupakan keputusan pihak kedutaan, segala keterlambatan kelengkapan dokumen bukan menjadi tanggung jawab travel agent. Biaya visa tetap harus dibayarkan walaupun visa tidak disetujui oleh Kedutaan, demikian juga jika terdapat biaya lain seperti pembatalan hotel, kereta dan atau tiket pesawat yang terjadi karena adanya tenggat waktu yang belum tentu sesuai dengan waktu penyelesaian proses visa dari Kedutaan, dan juga biaya tour lainnya maka akan dibebankan kepada Peserta tour.\r\n\r\nNOTE :\r\n\r\nVisa Schengen & Asuransi Perjalanan IDR. 2.500.000\r\nTipping Driver, Local Guide, Tour Leader IDR.  1.450.000\r\n* Surcharge peak season Rp 6.000.000,-\r\n*Harga Paket/Jadwal/Program/Fasilitas dapat berubah setiap saat menurut kondisi/situasi yang berlaku pada Penerbangan/Negara setempat\r\n*Harga untuk minimum keberangkatan 20 Peserta, dan akan disesuaikan jika tidak mencapai kuota keberangkatan minimum\r\n*Harga berdasarkan rate 1 EUR = Rp 15.500,- Dan akan disesuaikan dengan kurs yang berlaku pada saat transaksi.\r\n\r\nPrice Detail\r\nIDR 34.980.000\r\nInclude\r\nAkomodasi Hotel\r\nMakan\r\nTiket Obyek Wisata\r\nTiket Pesawat PP\r\nTour Guide\r\nTransportasi\r\nExclude\r\nAsuransi perjalanan\r\nBiaya pribadi lainnya\r\nCity Tour\r\nKelebihan berat bagasi\r\nPaspor\r\nTipping Guide dan Driver\r\nTour tambahan (optional) yang mungkin diadakan selama perjalanan\r\nVisa', 'wisata-islam.jpg', 13, 2, 0),
