(18, 29, 0, 0, 'UMROH AWAL RAMADHAN 09 HARI\r\n\r\nSabda Rasulullah SAW :\r\nIbadah Umrah yang satu ke Ibadah Umrah yang lainya menghapus dosa antara keduanya dan ibadah Haji yang Mabrur tiada lain balasanya kecuali Surga.', '<p><strong>HARI 01 : JAKARTA – JEDDAH – MADINAH   </strong><br>Dengan mengucap Bismillahi Tawakkaltu ‘Alallahi wala haula wala quwata illa billah, kita meninggalkan rumah menuju <strong>Bandara Internasional Soekarno Hatta (berkumpul di terminal 2E)</strong> untuk berangkat menuju <strong>Jeddah</strong>. Setelah tiba di <strong>Jeddah</strong> dan proses imigrasi menuju <strong>Madinah</strong> dengan menggunakan <strong>BUS AC</strong>. Tiba di <strong>Madinah</strong>, langsung <strong>Check In Hotel</strong>.<br><strong><br>HARI 02 : MADINAH</strong><br>Kegiatan hari ini jam <strong>7.30</strong> menuju <strong>Raudah</strong> dilanjutkan dengan Ziarah ke <strong>Makam Rasulullah SAW</strong>, <strong>Abu Bakar Shiddiq</strong>, <strong>Umar Bin Khattab</strong>, serta pemakaman para sahabat <strong>Rasulullah SAW</strong> dan keluarga beliau di <strong>Baqi Al-Gharqod</strong>. dilanjutkan dengan memperbanyak Tadarusan, <strong>Shalat Dzuhur</strong>, <strong>Ashar</strong>, <strong>Buka Puasa</strong>, dilanjutkan <strong>Shalat</strong>Berjamaah <strong>Maghrib</strong>, <strong>Isya</strong> dan <strong>Tarawih</strong>, kemudian Istirahat untuk persiapan Shalat Tahajud.<br><strong><br>HARI 03 : MADINAH</strong><br>Kegiatan hari ini <strong>Tour/Ziarah Kota Madinah</strong> dengan mengunjungi: <strong>Masjid Quba</strong>, <strong>Jabal Uhud</strong>, <strong>Perkebunan Kurma</strong>, <strong>Masjid Qiblatein</strong> dan <strong>Masjid Sab’ah</strong>. Dilanjutkan dengan memperbanyak Tadarusan, <strong>Shalat Ashar</strong>, <strong>Buka Puasa</strong>, dilanjutkan Shalat Berjamaah <strong>Maghrib</strong>, <strong>Isya</strong> dan <strong>Tarawih</strong>, kemudian Istirahat untuk persiapan Shalat Tahajud.<br><strong><br>HARI 04 : MADINAH – MAKKAH</strong><br>Pagi jam 08.00, bersiap-siap menuju <strong>Makkah</strong> dengan <strong>BUS AC</strong> dan mengambil Miqat<strong>umrah di Bir Ali</strong>, tiba di <strong>Makkah</strong> langsung <strong>Check In Hotel</strong>. Kemudian dilanjutkan dengan melaksanakan <strong>Tawaf</strong><strong> Umroh, Sai dan Tahallul</strong> di <strong>Masjidil Haram</strong>.<br><strong><br>HARI 05 : MAKKAH</strong><br>Acara bebas hari ini,  sambil memperbanyak ibadah <strong>tawaf</strong> di <strong>Masjidil Haram</strong>, ibadah ini yang tidak ada di tanah air. Memperbanyak Tadarusan, <strong>Shalat Dzuhur</strong>, <strong>Ashar</strong>, Buka Puasa, dilanjutkan Shalat Berjamaah <strong>Maghrib</strong>, <strong>Isya</strong> dan <strong>Tarawih</strong>, kemudian Istirahat untuk persiapan Shalat Tahajud.<br><strong><br>HARI 06 : MAKKAH</strong><br>Kegiatan hari ini jam <strong>07.30 City Tour/Ziarah</strong> tempat-tempat bersejarah [<strong>napak tilas Haji</strong>] di Kota <strong>Makkah</strong> diantaranya, <strong>Jabal Tsur</strong>, <strong>Padang Arafah</strong> [<strong>Masjid Namirah, Jabal Rahmah</strong>], <strong>Muzdalifah</strong>, <strong>Mina</strong> [<strong>tempat jemaah Haji melontar Jumroh</strong>], <strong>Jabal Nur</strong> dan terakhir <strong>Ja’ronah</strong> [bagi yang berkeinginan melaksanakan <strong>Umrah sunat</strong> dianjurkan membawa <strong>kain ihram</strong>]. melaksanakan <strong>Tawaf</strong>, <strong>Sai</strong> dan <strong>Tahallul</strong> Umrah di <strong>Masjidil Haram</strong>.</p>\r\n<p><strong>HARI 07 : MAKKAH</strong><br>Masih acara bebas hari ini,  sambil memperbanyak ibadah <strong>tawaf</strong> di <strong>Masjidil Haram</strong> dan melaksanakan <strong>Shalat Dzuhur</strong> di <strong>Masjidil Haram</strong>. Memperbanyak Tadarusan, <strong>Shalat Ashar</strong>, <strong>Buka Puasa</strong>, dilanjutkan Shalat Berjamaah <strong>Maghrib</strong>, <strong>Isya</strong> dan <strong>Tarawih</strong>, kemudian Istirahat untuk persiapan Shalat Tahajud.<br><strong><br>HARI 08 : MAKKAH – JEDDAH – JAKARTA</strong><br>Setelah <strong>Tawaf Wada</strong>, pagi jamaah meninggalkan <strong>Makkah</strong> menuju <strong>Jeddah</strong> untuk <strong>City Tour</strong> dan  <strong>shopping</strong> di <strong>Cournes</strong>, <strong>Laut Merah</strong> dan <strong>Masjid Terapung</strong> dilanjutkan ke <strong>Bandara King Abdul Aziz</strong> untuk menuju <strong>Tanah Air</strong>.<br><strong><br>HARI 09 : TIBA DI JAKARTA </strong><br>Insya Allah rombongan tiba di Jakarta.</p>\r\n<p><strong><em>Alhamdulillah berakhirlah acara Perjalanan suci kita, semoga segala amal ibadah Umrah kita Makbul diterima disisi Allah SWT, Amien Ya Rabbal Alamiin.</em></strong></p>', '', 30, 0, NULL, 'USD', 2800, 2700, 2600, 0, 100, '2018-05-16', '2018-05-25', 500, 450, 400, 0, 0),
