(21, 3, 0, 0, '10 Days West Europe Muslim Tour Free Keukenhof Holand & Roermond Designer Outlet', '<p><strong>10 Days West Europe Muslim Tour Free Keukenhof Holand & Roermond Designer Outlet</strong></p>\r\n<p><strong>Hari 1</strong></p>\r\n<p><strong>JAKARTA  Keberangkatan                                                                                    <br></strong>Semua peserta berkumpul di <strong>Bandara International Soekarno-Hatta, Terminal 2D Keberangkatan, (diharapkan tiba 3 jam sebelum keberangkatan) </strong>untuk proses check-in penerbangan dan immigrasi serta menunggu waktu boarding penerbangan ke kota <strong>Milan/Italia</strong></p>\r\n<p><strong>Hari 2</strong></p>\r\n<p><strong>MILAN – VENICE </strong>                                                                                                            <br>Pagi hari tiba di Milan mengunjungi <strong>Duomo Milan</strong> yang terkenal serta berkesempatan untuk singgah <strong>Galleria Vittorio Emanuel II</strong>, kemudian melanjutkan perjalanan menuju Venice. Tiba di Venice diajak menuju Tronchetto Pier, dengan menggunakan boat diajak mengunjungi Venice Island. Tiba di Venice Island makan siang di local restaurant kemudian waktu mengunjungi <strong>St. Marco Square Cathedral, Bridge of Sighs, Doge’s Place</strong>, atau <strong>naik gondola</strong> <strong><em>(optional dengan biaya masing-masing)</em></strong> mengelilingi kanal2 kota Venice yang menyajikan suasana romantis. Setelah makan malam dilokal restaurant diantar ke hotel untuk beristirahat. <strong>(-, MS, MM)</strong></p>\r\n<p><strong>Hari 3</strong></p>\r\n<p><strong>VENICE – BERGAMO – LUCERNE                                                                                    <br></strong>Pagi hari meninggalkan kota Venice dengan penuh kenangan menuju kota Lucerne / Swiss dengan melalui salah satu terowongan terpanjang di dunia yaitu <strong>St. GOTARD.</strong> Dalam perjalanan singgah di kota kecil  Bergamo untuk makan siang dan orientasi kota sejenak melanjutkan perjalanan menuju Swiss. Sore hari tiba di Lucerne makan malam bersama di lokal restaurant kemudian diantar ke hotel untuk beristirahat. <strong>(MP, MS, MM)</strong></p>\r\n<p><strong>Hari 4</strong></p>\r\n<p><strong>LUCERNE – ENGELBERG – Mt. TITLIS – LUCERNE                                                                                                    <br></strong>Setelah makan pagi di hotel, Anda akan diantar menuju Engelberg untuk naik cable car menuju puncak <strong>Gunung Titli</strong>s diketinggian 2030 dpl. Selanjutnya dengan cable car juga kembali menuju Engelberg. Wisata berikutnya di Lucerne mengunjungi <strong>Chapel Bridge, Old Town & Lucerne Lake</strong> dan berburu jam mewah hingga waktu makan malam  dan kembali ke hotel  untuk istirahat. <strong>(MP, MS, MM)</strong></p>\r\n<p><strong>Hari 5</strong></p>\r\n<p><strong>LUCERNE – DIJON – PARIS                                                                                                                     <br></strong>Setelah makan pagi dan check-out hotel, perjalanan hari ini menuju pusat kota mode dunia, <strong>Paris. </strong>Dalam perjalanan singgah di kota <strong>Dijon</strong> untuk makan siang serta city tour di <strong>kota tua Dijon. </strong>Sore hari tiba di kota <strong>Paris </strong>diajak makan malam di local restoran kemudian diantar  dan menuju ke hotel untuk beristirahat. <strong>(MP, MS, MM )</strong></p>\r\n<p><strong>Hari 6</strong></p>\r\n<p><strong>PARIS CITY TOUR                                                                                                            <br></strong>Pagi hari city tour di kota Paris mengunjungi/melewati <strong>Place de la Concorde, Champs Elysees, Arc du Triomphe, Louvre Museum, </strong> mengunjungi<strong> Eiffel Tower</strong> untuk menikmati panorama kota Paris dari ketinggian level 2, kemudian shalat di <strong>Grande Mosque (Masjid Raya Paris).</strong> Setelah makan siang Anda berkesempatan belanja di <strong>Galeries Lafayette. </strong>Jika waktu memungkinkan Anda dapat mengikuti tour (dengan tambahan biaya sendiri) menyusuri <strong>Sungai Seine </strong>dengan <strong>Bateaux Mouches Cruise</strong> hingga tiba waktunya untuk diantar check-in hotel di Paris & beristirahat. <strong>(MP,MS,MM)</strong></p>\r\n<p><strong>Hari 7</strong></p>\r\n<p><strong>PARIS – BRUSSELS – AMSTERDAM                                                                              <br></strong>Setelah makan pagi dan check-out hotel, melanjutkan perjalanan menunju Amsterdam. Dalam perjalanan singgah di <strong>Brussels</strong> mengunjungi <strong>Maneken Pis, Royal Palace, Town Hall photo stop di Atominium </strong>dan shalat di <strong>Masjid Raya Brussels., </strong>kemudian melanjutkan perjalanan menuju Amsterdam untuk makan malam kemudian diantar ke hotel untuk beristirahat.<strong> (MP, MS, MM)</strong></p>\r\n<p><strong>Hari 8</strong></p>\r\n<p><strong>AMSTERDAM –  VOLENDAM – AMSTERDAM                                                                    <br></strong>Acara wisata dimulai dari hotel dengan kunjungan ke <strong>Volendam</strong> untuk mengunjungi <strong>Traditional Fisherman Village</strong>, dimana Anda dapat berfoto dengan <strong>pakaian khas nelayan</strong> Belanda. Setelah makan siang kembali ke kota kota Amsterdam untuk menikmati keunikan serta keindahan kota Amsterdam dengan <strong>Canal Cruise, </strong>kemudian diajak mengunjungi salah satu pabrik pengasahan berlian yang terkenal di dunia,<strong>  </strong>Dilanjutkan  makan malam dan kembali ke hotel di Amsterdam untuk istirahat. <strong>(MP, MS, MM)</strong> </p>\r\n<p><strong>Hari 9</strong></p>\r\n<p><strong>AMSTERDAM – KEUKENHOF – AMSTERDAM                                                                                            <br></strong>Setelah makan pagi anda akan diantar ke kota <strong>Lisse</strong> untuk melihat pameran <strong>Bunga Tulip Keukenhoff</strong>yang ada hanya setahun sekali di musim semi, hingga tiba saatnya diantar ke airport untuk penerbangan kembali ke Jakarta. <strong>(MP)</strong></p>\r\n<p><strong>Hari 10</strong></p>\r\n<p><strong>JAKARTA Kedatangan                                                                 <br></strong>Hari ini tiba kembali di Jakarta. Terima kasih atas keikut sertaannya bersama jasmina Experience. Semoga membawa kenangan indah yang tidak terlupakan.</p>\r\n<p><strong>MP</strong>= Makan Pagi           <strong>MS</strong>= Makan Siang            <strong>MM</strong>= Makan Malam          <strong>MOB </strong>= Makan di Pesawat</p>', '', 30, 0, NULL, 'IDR', 28980000, 27750000, 26500000, 25500000, 0, '2018-07-10', '2018-07-20', 3500000, 0, 0, 0, 1),
